"precision highp float;
varying highp vec2 textureCoordinate;

uniform sampler2D inputImageTexture;

uniform lowp vec3 nextRGB;
uniform lowp vec3 lineRGB;
uniform float yOffset; // used for 10% Y-upshift - this is no longer used

void main()
{

    highp vec2 newTextureCoordinate = textureCoordinate + vec2(0.0, yOffset);

    lowp vec4 textureColor = texture2D(inputImageTexture, newTextureCoordinate);

    gl_FragColor = vec4((lineRGB * textureColor.rgb * max(sign(1.0 - newTextureCoordinate.y), 0.0)) //paint the lines with RGB, except for the bottom 25%
                        + (nextRGB * (1.0 - textureColor.rgb) * max(sign(1.0 - newTextureCoordinate.y), 0.0)) // paint the background with RGB, except for the bottom 25%
                        + (nextRGB * max(sign(newTextureCoordinate.y - 1.0), 0.0)) //paint the bottom 25% with background RGB
                        , 1.0);
}"

"precision highp float;
//#gljs varname: 'iProov.webgl.shader.blur.fragment', type: 'fragment'

uniform sampler2D inputImageTexture;
uniform float h;

varying vec2 textureCoordinate;

void main() {

    vec4 sum = vec4( 0.0 );

    sum += texture2D( inputImageTexture, vec2( textureCoordinate.x - 4.0 * h, textureCoordinate.y ) ) * 0.0276305489;
    sum += texture2D( inputImageTexture, vec2( textureCoordinate.x - 3.0 * h, textureCoordinate.y ) ) * 0.0662822425;
    sum += texture2D( inputImageTexture, vec2( textureCoordinate.x - 2.0 * h, textureCoordinate.y ) ) * 0.123831533;
    sum += texture2D( inputImageTexture, vec2( textureCoordinate.x - 1.0 * h, textureCoordinate.y ) ) * 0.180173814;
    sum += texture2D( inputImageTexture, vec2( textureCoordinate.x, textureCoordinate.y ) ) * 0.204163685;
    sum += texture2D( inputImageTexture, vec2( textureCoordinate.x + 1.0 * h, textureCoordinate.y ) ) * 0.180173814;
    sum += texture2D( inputImageTexture, vec2( textureCoordinate.x + 2.0 * h, textureCoordinate.y ) ) * 0.123831533;
    sum += texture2D( inputImageTexture, vec2( textureCoordinate.x + 3.0 * h, textureCoordinate.y ) ) * 0.0662822425;
    sum += texture2D( inputImageTexture, vec2( textureCoordinate.x + 4.0 * h, textureCoordinate.y ) ) * 0.0276305489;

    gl_FragColor = sum;

}"

"precision highp float;
//#gljs varname: 'iProov.webgl.shader.inclusion.fragment', type: 'fragment'

uniform sampler2D inputImageTexture;
uniform vec2 uWindow;
uniform float threshold;

varying vec2 textureCoordinate;

void main() {

    vec2 offset = threshold / uWindow;

    float bottomLeftIntensity = texture2D(inputImageTexture, textureCoordinate + vec2(-offset.x, offset.y)).r;
    float topRightIntensity = texture2D(inputImageTexture, textureCoordinate + vec2(offset.x, -offset.y)).r;
    float topLeftIntensity = texture2D(inputImageTexture, textureCoordinate + vec2(-offset.x, -offset.y)).r;
    float bottomRightIntensity = texture2D(inputImageTexture, textureCoordinate + vec2(offset.x, offset.y)).r;
    float leftIntensity = texture2D(inputImageTexture, textureCoordinate + vec2(-offset.x, 0.0)).r;
    float rightIntensity = texture2D(inputImageTexture, textureCoordinate + vec2(offset.x, 0.0)).r;
    float bottomIntensity = texture2D(inputImageTexture, textureCoordinate + vec2(0.0, offset.y)).r;
    float topIntensity = texture2D(inputImageTexture, textureCoordinate + vec2(0.0, -offset.y)).r;
    float centerIntensity = texture2D(inputImageTexture, textureCoordinate).r;

    float pixelIntensitySum = bottomLeftIntensity + topRightIntensity + topLeftIntensity + bottomRightIntensity + leftIntensity + rightIntensity + bottomIntensity + topIntensity + centerIntensity;
    float sumTest = step(1.5, pixelIntensitySum);
    float pixelTest = step(0.01, centerIntensity);

    gl_FragColor = vec4(vec3(sumTest * pixelTest, sumTest * pixelTest, sumTest * pixelTest), 1.0);

}"

"precision highp float;
//#gljs varname: 'iProov.webgl.shader.luminance.fragment', type: 'fragment'

const vec3 W = vec3(0.2125, 0.7154, 0.0721);

uniform sampler2D inputImageTexture;

varying vec2 textureCoordinate;

void main() {

    vec4 textureColor = texture2D(inputImageTexture, textureCoordinate);
    float luminance = dot(textureColor.rgb, W);

    gl_FragColor = vec4(vec3(luminance), textureColor.a);

}"

"precision highp float;
//#gljs varname: 'iProov.webgl.shader.sobel.fragment', type: 'fragment'

uniform sampler2D inputImageTexture;
uniform vec2 uWindow;
uniform float threshold;

varying vec2 textureCoordinate;

void main() {

    vec2 offset = threshold / uWindow;

    float bottomLeftIntensity = texture2D(inputImageTexture, textureCoordinate + vec2(-offset.x, offset.y)).r;
    float topRightIntensity = texture2D(inputImageTexture, textureCoordinate + vec2(offset.x, -offset.y)).r;
    float topLeftIntensity = texture2D(inputImageTexture, textureCoordinate + vec2(-offset.x, -offset.y)).r;
    float bottomRightIntensity = texture2D(inputImageTexture, textureCoordinate + vec2(offset.x, offset.y)).r;
    float leftIntensity = texture2D(inputImageTexture, textureCoordinate + vec2(-offset.x, 0.0)).r;
    float rightIntensity = texture2D(inputImageTexture, textureCoordinate + vec2(offset.x, 0.0)).r;
    float bottomIntensity = texture2D(inputImageTexture, textureCoordinate + vec2(0.0, offset.y)).r;
    float topIntensity = texture2D(inputImageTexture, textureCoordinate + vec2(0.0, -offset.y)).r;

    vec2 gradientDirection;
    gradientDirection.x = -bottomLeftIntensity - 2.0 * leftIntensity - topLeftIntensity + bottomRightIntensity + 2.0 * rightIntensity + topRightIntensity;
    gradientDirection.y = -topLeftIntensity - 2.0 * topIntensity - topRightIntensity + bottomLeftIntensity + 2.0 * bottomIntensity + bottomRightIntensity;

    float gradientMagnitude = length(gradientDirection);
    vec2 normalizedDirection = normalize(gradientDirection);

    normalizedDirection = sign(normalizedDirection) * floor(abs(normalizedDirection) + 0.617316); // Offset by 1-sin(pi/8) to set to 0 if near axis, 1 if away
    normalizedDirection = (normalizedDirection + 1.0) * 0.5; // Place -1.0 - 1.0 within 0 - 1.0

    gl_FragColor = vec4(gradientMagnitude, normalizedDirection.x, normalizedDirection.y, 1.0);
    //gl_FragColor = vec4(gradientMagnitude, gradientMagnitude, gradientMagnitude, 1.0); // Normal edge detection version
}"

"precision highp float;
//#gljs varname: 'iProov.webgl.shader.suppression.fragment', type: 'fragment'

uniform sampler2D inputImageTexture;
uniform highp float texelWidth;
uniform highp float texelHeight;
uniform mediump float upperThreshold;
uniform mediump float lowerThreshold;

varying highp vec2 textureCoordinate;

void main() {

    vec3 currentGradientAndDirection = texture2D(inputImageTexture, textureCoordinate).rgb;
    vec2 gradientDirection = ((currentGradientAndDirection.gb * 2.0) - 1.0) * vec2(texelWidth, texelHeight);

    float firstSampledGradientMagnitude = texture2D(inputImageTexture, textureCoordinate + gradientDirection).r;
    float secondSampledGradientMagnitude = texture2D(inputImageTexture, textureCoordinate - gradientDirection).r;

    float multiplier = step(firstSampledGradientMagnitude, currentGradientAndDirection.r);
    multiplier = multiplier * step(secondSampledGradientMagnitude, currentGradientAndDirection.r);

    float thresholdCompliance = smoothstep(lowerThreshold, upperThreshold, currentGradientAndDirection.r);
    multiplier = multiplier * thresholdCompliance;

    gl_FragColor = vec4(multiplier, multiplier, multiplier, 1.0);

}"

"precision highp float;
//#gljs varname: 'iProov.webgl.shader.blur.fragment', type: 'fragment'

uniform sampler2D inputImageTexture;
uniform float v;

varying vec2 textureCoordinate;

void main() {

    vec4 sum = vec4( 0.0 );

    sum += texture2D( inputImageTexture, vec2( textureCoordinate.x, textureCoordinate.y - 4.0 * v ) ) * 0.0276305489;
    sum += texture2D( inputImageTexture, vec2( textureCoordinate.x, textureCoordinate.y - 3.0 * v ) ) * 0.0662822425;
    sum += texture2D( inputImageTexture, vec2( textureCoordinate.x, textureCoordinate.y - 2.0 * v ) ) * 0.123831533;
    sum += texture2D( inputImageTexture, vec2( textureCoordinate.x, textureCoordinate.y - 1.0 * v ) ) * 0.180173814;
    sum += texture2D( inputImageTexture, vec2( textureCoordinate.x, textureCoordinate.y ) ) * 0.204163685;
    sum += texture2D( inputImageTexture, vec2( textureCoordinate.x, textureCoordinate.y + 1.0 * v ) ) * 0.180173814;
    sum += texture2D( inputImageTexture, vec2( textureCoordinate.x, textureCoordinate.y + 2.0 * v ) ) * 0.123831533;
    sum += texture2D( inputImageTexture, vec2( textureCoordinate.x, textureCoordinate.y + 3.0 * v ) ) * 0.0662822425;
    sum += texture2D( inputImageTexture, vec2( textureCoordinate.x, textureCoordinate.y + 4.0 * v ) ) * 0.0276305489;

    gl_FragColor = sum;

}"

"precision highp float;
uniform sampler2D inputImageTexture;
uniform sampler2D inputImageTexture2;
uniform vec4 blend;
uniform vec4 fade;
uniform int shouldFade;

varying vec2 textureCoordinate;

void main(void) {

    float step1 = 0.8;
    float step2 = 0.6;
    float step3 = 0.3;
    float step4 = 0.15;
    float alpha = 1.0;

    vec3 shade = vec3(1.0);
    vec4 color = vec4(1.0);

    vec4 texelLines = texture2D(inputImageTexture, textureCoordinate);
    vec4 texelShade = texture2D(inputImageTexture2, textureCoordinate);

    float brightness = (0.2126 * texelShade.r) + (0.7152 * texelShade.g) + (0.0722 * texelShade.b);
    float brightest = max(max(texelShade.r, texelShade.g), texelShade.b);
    float dimmest = min(min(texelShade.r, texelShade.g), texelShade.b);
    float delta = brightest - dimmest;

    if (delta > 0.1) {
        texelShade = texelShade * (1.0 / brightest);
    } else {
        texelShade.rgb = vec3(1.0);
    }

    if (brightness < step1) {
        shade = vec3(texelShade.rgb * step1);
    }

    if (brightness < step2) {
        shade = vec3(texelShade.rgb * step2);
    }

    if (brightness < step3) {
        shade = vec3(texelShade.rgb * step3);
    }

    if (brightness < step4) {
        shade = vec3(texelShade.rgb * step4);
    }

    if (texelLines.rgb == vec3(0.0)) {
        color = 1.0 - vec4(mix(shade, blend.rgb, blend.a), 0.0);
    }

    if (shouldFade == 1) {
        if (fade.x > 0.0) {
            alpha *= smoothstep(0.0, fade.x * abs(sin(0.5)), vec4(textureCoordinate, 1.0 - textureCoordinate)).x;
        }

        if (fade.y > 0.0) {
            alpha *= smoothstep(0.0, fade.y * abs(sin(0.5)), vec4(textureCoordinate, 1.0 - textureCoordinate)).y;
        }

        if (fade.z > 0.0) {
            alpha *= smoothstep(0.0, fade.z * abs(sin(0.5)), vec4(textureCoordinate, 1.0 - textureCoordinate)).z;
        }

        if (fade.w > 0.0) {
            alpha *= smoothstep(0.0, fade.w * abs(sin(0.5)), vec4(textureCoordinate, 1.0 - textureCoordinate)).w;
        }

        if (fade != vec4(0.0)) {
            color = vec4(mix(vec3(0.0), color.rgb, alpha), 1.0);
        }
    }

    gl_FragColor = color;

}"

"precision highp float;
uniform sampler2D inputImageTexture;
varying vec2 textureCoordinate;
uniform float a;
uniform float b;

void main() {
    vec2 uv = textureCoordinate * (1.0 - textureCoordinate.yx);
    float vig = uv.x * uv.y * a;
    vig = pow(vig, b);
    gl_FragColor = vec4(vig) * texture2D(inputImageTexture, textureCoordinate);
}"
